// SPDX-License-Identifier: GPL-3.0
pragma solidity 0.8.13;


contract Project {

    enum State {
        Fundraising,
        Expired,
        Successful
    }
    address payable public projectCreator;
    string projectTitle;
    string projectDescription; // IPFS
    uint256 amountGoal;
    uint256 currentBalance;
    State state;
    uint256 nbDays; // To be converted to date
    mapping(address=>uint) contributions;








    function getProjectTitle() public view returns(string memory) {
        return projectTitle;
    }

    function setProjectTitle(string memory _projectTitle) public {
        projectTitle = _projectTitle;
    }




}

